import React, { useState } from 'react';
import '@fortawesome/fontawesome-free/css/all.min.css';
import { Menu, LogOut, FileText, ChevronLeft} from 'lucide-react';

export function Dashboard() {
  const [isOpen, setIsOpen] = useState(false);

  const toggleSidebar = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div
      className={`h-screen bg-gray-200 text-gray-900 flex flex-col transition-all duration-300 ease-in-out ${
        isOpen ? 'w-64' : 'w-16'
      }`}
    >
      <nav className="flex flex-col flex-grow">
        <button
          className="w-full py-3 px-4 flex items-center justify-between hover:bg-gray-300 transition-colors duration-200"
          onClick={toggleSidebar}
        >
          <div className="flex items-center">
            <Menu className="w-6 h-6 mr-3" />
            {isOpen && <span className="text-lg font-medium">Menu</span>}
          </div>
          {isOpen && (
            <ChevronLeft className="w-5 h-5" />
          )}
        </button>

        <button className="w-full py-3 px-4 flex items-center hover:bg-gray-300 transition-colors duration-200">
          <FileText className="w-6 h-6 mr-3" />
          {isOpen && <span className="text-lg">Soal</span>}
        </button>

        {/* Add more menu items here */}
      </nav>

      <div className="mt-auto">
        <button className="w-full py-3 px-4 flex items-center hover:bg-gray-300 transition-colors duration-200">
          <LogOut className="w-6 h-6 mr-3" />
          {isOpen && <span className="text-lg">Logout</span>}
        </button>
      </div>
    </div>
  );
}

export default Dashboard;
